    data: |
      SELECT DISTINCT + col1 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - + col0 + - CAST ( NULL AS REAL ) + + col0 * 38 * + 12 <= NULL AND NOT - col0 IS NOT NULL;
  - name: tab2

outputs:
  - name: q3527.out
    data: |
